B.a_f=new A.bt("\u0110\u01b0\u1ee3c th\xe0nh l\u1eadp t\u1eeb n\u0103m 2011, cho \u0111\u1ebfn nay, Bamboo Capital \u0111\xe3 tr\u1edf th\xe0nh m\u1ed9t trong nh\u1eefng t\u1eadp \u0111o\xe0n \u0111a ng\xe0nh h\xe0ng \u0111\u1ea7u Vi\u1ec7t Nam v\u1edbi h\u01a1n 60 c\xf4ng ty th\xe0nh vi\xean v\xe0 li\xean k\u1ebft.\n            \n            Trong b\u1ed1i c\u1ea3nh n\u1ec1n kinh t\u1ebf trong n\u01b0\u1edbc c\xf3 nh\u1eefng chuy\u1ec3n bi\u1ebfn t\xedch c\u1ef1c, T\u1eadp \u0111o\xe0n Bamboo Capital v\u1edbi v\u1ecb th\u1ebf m\u1ed9t trong nh\u1eefng c\xf4ng ty \u0111\u1ea7u t\u01b0 \u0111a ng\xe0nh h\xe0ng \u0111\u1ea7u Vi\u1ec7t Nam, b\u1eb1ng s\u1ef1 nhi\u1ec7t huy\u1ebft v\xe0 kinh nghi\u1ec7m \u0111\xe3 v\xe0 \u0111ang ch\u1ee7 \u0111\u1ed9ng chuy\u1ec3n m\xecnh, v\u1eadn d\u1ee5ng ti\u1ec1m l\u1ef1c v\u1ed1n c\xf3 nh\u1eb1m t\u0103ng c\u01b0\u1eddng s\u1ee9c h\xfat, s\u1eb5n s\xe0ng gia nh\u1eadp s\u1ef1 thay \u0111\u1ed5i c\u1ee7a th\u1ecb tr\u01b0\u1eddng.\n            \n            BCG \u0111\u1ecbnh h\u01b0\u1edbng tr\u1edf th\xe0nh m\u1ed9t trong nh\u1eefng \u0111\u01a1n v\u1ecb ph\xe1t tri\u1ec3n n\u0103ng l\u01b0\u1ee3ng t\xe1i t\u1ea1o h\xe0ng \u0111\u1ea7u t\u1ea1i Vi\u1ec7t Nam, \u0111\xe2y l\xe0 l\u0129nh v\u1ef1c \u0111\xf3ng vai tr\xf2 h\u1ea1t nh\xe2n chi\u1ebfn l\u01b0\u1ee3c trong t\u01b0\u01a1ng lai tr\xean c\u01a1 s\u1edf ph\xe1t tri\u1ec3n b\u1ec1n v\u1eefng c\u1ee7a c\xe1c l\u0129nh v\u1ef1c tr\u1ecdng y\u1ebfu kh\xe1c: s\u1ea3n xu\u1ea5t - n\xf4ng nghi\u1ec7p, x\xe2y d\u1ef1ng - th\u01b0\u01a1ng m\u1ea1i, c\u01a1 s\u1edf h\u1ea1 t\u1ea7ng - b\u1ea5t \u0111\u1ed9ng s\u1ea3n.\n            S\u1ee9 m\u1ec7nh c\u1ee7a BCG l\xe0 kh\xf4ng ng\u1eebng x\xe2y d\u1ef1ng l\xf2ng tin v\xe0 gi\xe1 tr\u1ecb cho \u0111\u1ed1i t\xe1c, kh\xe1ch h\xe0ng, c\u1ed5 \u0111\xf4ng v\xe0 c\xe1n b\u1ed9 c\xf4ng nh\xe2n vi\xean th\xf4ng qua vi\u1ec7c ph\xe1t tri\u1ec3n d\u1ef1 \xe1n \u0111\u1ed3ng th\u1eddi hi\u1ec7n th\u1ef1c h\xf3a th\xe0nh c\xf4ng c\xe1c c\u01a1 h\u1ed9i kinh doanh d\u1ef1a tr\xean n\u1ec1n t\u1ea3ng kinh nghi\u1ec7m, c\xe1c m\u1ed1i quan h\u1ec7 v\u1eefng ch\u1eafc v\xe0 nh\u1eefng hi\u1ec3u bi\u1ebft s\xe2u r\u1ed9ng v\u1ec1 v\u0103n h\xf3a \u0111\u1ecba ph\u01b0\u01a1ng c\u0169ng nh\u01b0 qu\u1ed1c t\u1ebf.\n            \n            L\u1ea5y s\u1ef1 g\u1eafn k\u1ebft ngu\u1ed3n nh\xe2n l\u1ef1c l\xe0m tr\u1ecdng t\xe2m cho vi\u1ec7c ph\xe1t tri\u1ec3n doanh nghi\u1ec7p, BCG \u0111\xe3 th\xe0nh c\xf4ng x\xe2y d\u1ef1ng n\xean n\u1ec1n t\u1ea3ng c\xe1c gi\xe1 tr\u1ecb cho ng\u01b0\u1eddi lao \u0111\u1ed9ng. M\u1ed7i th\xe0nh vi\xean trong \u0111\u1ea1i gia \u0111\xecnh BCG \u0111\u1ec1u l\xe0 nh\u1eefng c\xe1 nh\xe2n c\xf3 \xfd th\u1ee9c l\xe0m vi\u1ec7c cao, tinh th\u1ea7n t\u1ef1 ch\u1ee7, tr\xe1ch nhi\u1ec7m v\xe0 trung th\u1ef1c. H\u1ed9i \u0111\u1ed3ng qu\u1ea3n tr\u1ecb v\xe0 c\xe1c s\xe1ng l\xe2p vi\xean t\u1ea1o d\u1ef1ng c\u1ea3m h\u1ee9ng, \u0111\u1ed9ng l\u1ef1c t\u0103ng tr\u01b0\u1edfng cho T\u1eadp \u0111o\xe0n b\u1eb1ng c\xe1ch n\u1ed7 l\u1ef1c x\xe2y d\u1ef1ng v\u0103n h\xf3a doanh nghi\u1ec7p, m\xf4i tr\u01b0\u1eddng l\xe0m vi\u1ec7c m\xe0 \u1edf \u0111\xe2y t\u1ea5t c\u1ea3 c\xe1n b\u1ed9 c\xf4ng nh\xe2n vi\xean c\xf3 c\u1ea3m gi\xe1c l\xe0 nh\xe0, t\u1ef1 h\xe0o l\xe0 m\u1ed9t ph\u1ea7n c\u1ee7a t\u1eadp th\u1ec3, d\xe1m m\u01a1 nh\u1eefng gi\u1ea5c m\u01a1 l\u1edbn v\xe0 l\xe0m nh\u1eefng \u0111i\u1ec1u tuy\u1ec7t v\u1eddi trong h\xe0nh tr\xecnh c\xf9ng BCG.",null,B.Au,null,null,null,null,null,null)
